import React from 'react'
import styled from 'styled-components'

const Pay = () => {
 

  return (
    <Container>
        <Button>Pay Now</Button>
    </Container>
  )
}
const Container = styled.div`
height: 100vh;
display: flex;
justify-content: center;
align-items: center;
`
const Button = styled.button`
width: 100px;
padding: 15px;
background-color: #000;
color: #fff;
border-radius: 8px;
border: none;

`
export default Pay
